CREATE FUNCTION _userconfig_trigger() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  kode_divisi INTEGER;
  kode_proyek INTEGER;
BEGIN
	IF tg_op = 'INSERT' THEN
		IF NEW.id_relasi IS NOT NULL THEN
			IF (NEW.is_proyek IS NOT NULL AND NEW.is_proyek = FALSE) THEN	
				SELECT d.id_subunitkerja
				INTO kode_divisi
				FROM tbl_user a, tbl_unitkerja c, tbl_subunitkerja d, tbl_relunitkerja e
				WHERE (a.id_relasi = c.id_unitkerja AND c.id_unitkerja = e.id_unitkerja AND d.id_subunitkerja = e.id_subunitkerja AND a.is_proyek = 'f' AND a.user_id = NEW.user_id)
				ORDER BY d.nama_subunit ASC
				LIMIT 1;
			
				SELECT b.id_proyek
				INTO kode_proyek
				FROM tbl_user a, tbl_unitkerja c, tbl_subunitkerja d, tbl_relunitkerja e, tbl_proyek b
				WHERE (
				a.id_relasi = c.id_unitkerja AND
				c.id_unitkerja = e.id_unitkerja AND
				d.id_subunitkerja = e.id_subunitkerja AND
				d.id_subunitkerja = b.id_subunitkerja and
				a.is_proyek = 'f' AND
				a.user_id = NEW.user_id)
				order by d.nama_subunit, b.nama_proyek asc
				LIMIT 1;
			END IF;
			
			IF (NEW.is_proyek IS NOT NULL AND NEW.is_proyek = TRUE) THEN	
				SELECT b.id_proyek
				INTO kode_proyek
				FROM tbl_user a, tbl_proyek b
				WHERE(a.id_relasi = b.id_proyek AND a.is_proyek = 't' AND a.user_id = NEW.user_id)
				LIMIT 1;
				
				SELECT c.id_subunitkerja
				INTO kode_divisi
				FROM tbl_user a, tbl_proyek b, tbl_subunitkerja c
				WHERE(a.id_relasi = b.id_proyek and c.id_subunitkerja = b.id_subunitkerja and a.is_proyek = 't'  AND a.user_id = NEW.user_id)
				LIMIT 1;
			END IF;
		END IF;
		RETURN NEW;
	END IF;
	
	IF tg_op = 'UPDATE' THEN
		IF NEW.id_relasi != OLD.id_relasi THEN
			IF (NEW.is_proyek IS NOT NULL AND NEW.is_proyek = FALSE) THEN	
				SELECT d.id_subunitkerja
				INTO kode_divisi
				FROM tbl_user a, tbl_unitkerja c, tbl_subunitkerja d, tbl_relunitkerja e
				WHERE (a.id_relasi = c.id_unitkerja AND c.id_unitkerja = e.id_unitkerja AND d.id_subunitkerja = e.id_subunitkerja AND a.is_proyek = 'f' AND a.user_id = NEW.user_id)
				ORDER BY d.nama_subunit ASC
				LIMIT 1;
			
				SELECT b.id_proyek
				INTO kode_proyek
				FROM tbl_user a, tbl_unitkerja c, tbl_subunitkerja d, tbl_relunitkerja e, tbl_proyek b
				WHERE (
				a.id_relasi = c.id_unitkerja AND
				c.id_unitkerja = e.id_unitkerja AND
				d.id_subunitkerja = e.id_subunitkerja AND
				d.id_subunitkerja = b.id_subunitkerja and
				a.is_proyek = 'f' AND
				a.user_id = NEW.user_id)
				order by d.nama_subunit, b.nama_proyek asc
				LIMIT 1;
				UPDATE tbl_userconfig SET kolom1 = kode_divisi, kolom2 = kode_proyek WHERE user_id = NEW.user_id;
			END IF;
			
			IF (NEW.is_proyek IS NOT NULL AND NEW.is_proyek = TRUE) THEN	
				SELECT b.id_proyek
				INTO kode_proyek
				FROM tbl_user a, tbl_proyek b
				WHERE(a.id_relasi = b.id_proyek AND a.is_proyek = 't' AND a.user_id = NEW.user_id)
				LIMIT 1;
				
				SELECT c.id_subunitkerja
				INTO kode_divisi
				FROM tbl_user a, tbl_proyek b, tbl_subunitkerja c
				WHERE(a.id_relasi = b.id_proyek and c.id_subunitkerja = b.id_subunitkerja and a.is_proyek = 't'  AND a.user_id = NEW.user_id)
				LIMIT 1;
				UPDATE tbl_userconfig SET kolom1 = kode_divisi, kolom2 = kode_proyek WHERE user_id = NEW.user_id;
			END IF;
		END IF;
		RETURN NEW;
	END IF;

	IF tg_op = 'DELETE' THEN
		DELETE FROM tbl_userconfig WHERE tbl_userconfig.user_id = OLD.user_id;
	RETURN OLD;
	END IF;
	
END;
$$;


