CREATE FUNCTION check_isexist(integer, character varying, integer, integer) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$
DECLARE
	rtn BOOLEAN;
BEGIN
	SELECT INTO rtn a.id_saldo
	FROM tbl_saldo a
	WHERE
	a.id_proyek = $1 AND a.kodeperkiraan = $2 AND a.tahun = $3 AND a.bulan = $4;

	IF NOT FOUND THEN
		RETURN FALSE;
	ELSE
		RETURN TRUE;
	END IF;
END;
$_$;


