--
-- TOC entry 294 (class 1255 OID 1757164)
-- Name: check_nobukti(timestamp without time zone, integer, character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION check_nobukti(tanggal timestamp without time zone, id_param integer, tipe_param character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
  kode_param varchar := '';
  ret_type varchar := '';
  ret varchar := '';
  _r RECORD;
BEGIN
    
SELECT a.period_id, a.period_closed, a.period_freeze
INTO _r
FROM period a
WHERE ((tanggal::timestamp with time zone BETWEEN a.period_start::date AND a.period_end::date) AND a.id_proyek = id_param);

-- Make sure that this period is exist
IF (NOT FOUND) THEN
RETURN -1;
END IF;

-- Make sure that this period is closed
IF (_r.period_closed) THEN
RETURN -2;
END IF;
    
SELECT a.kode_proyek
INTO kode_param
FROM tbl_proyek a
WHERE a.id_proyek = id_param;    

SELECT a.confdata
INTO ret_type 
FROM configs a
WHERE a.confname = 'app_type';

SELECT mylpad(a.nilai,4,'0') 
INTO ret
FROM tbl_nobukti a
WHERE (lower(a.kode_proyek::text)::text = lower(kode_param)::text 
AND a.tahun::integer = to_char(tanggal::timestamp with time zone, 'YYYY'::text)::integer
AND a.bulan::integer = to_char(tanggal::timestamp with time zone, 'MM'::text)::integer);
IF (NOT FOUND) THEN
-- buatkan record nomor bukti pada bulan tersebut
    RETURN UPPER(ret_type)||'/'||UPPER(COALESCE(kode_param,'-'))||'/'||UPPER(tipe_param)||'/'||mylpad(1,4,'0')||'/'||trim(both from to_char((to_char(tanggal::timestamp with time zone, 'MM'::text))::numeric,'RN')::text)||'/'||to_char(tanggal,'YYYY');
ELSE
-- baca nomor bukti tersebut
    RETURN UPPER(ret_type)||'/'||UPPER(COALESCE(kode_param,'-'))||'/'||UPPER(tipe_param)||'/'||ret||'/'||trim(both from to_char((to_char(tanggal::timestamp with time zone, 'MM'::text))::numeric,'RN')::text)||'/'||to_char(tanggal,'YYYY');
END IF;

END;
$$;


ALTER FUNCTION public.check_nobukti(tanggal timestamp without time zone, id_param integer, tipe_param character varying) OWNER TO postgres;

