--

CREATE FUNCTION get_labarugi() RETURNS SETOF record
    LANGUAGE plpgsql
    AS $$
declare
    jurnal  record;
    results record;
    recs    record;
begin
for jurnal in
	   select 
           id_proyek,
	   cast(date_part('year', tanggal) as CHARACTER VARYING) as tahun, 
	   cast(date_part('month', tanggal) as CHARACTER VARYING) as bulan,
	   cast(date_part('day',(date_trunc('MONTH', tanggal)+ INTERVAL '1 MONTH - 1 day')::date) as CHARACTER VARYING) as hari
	   from tbl_jurnal
	   group by id_proyek,tahun,bulan,hari
    loop
    for results in 
		select jurnal.id_proyek,jurnal.tahun,jurnal.bulan,jurnal.hari,a.id_group, a.nmlama, a.gname, 
		(select count(x.id_group) from tbl_group_labarugi x where x.parents = a.id_group) as childs,
		SUM(CASE WHEN a.bawah != '' AND a.atas != '' THEN (CASE WHEN date(c.tanggal) BETWEEN to_date('1-'||jurnal.bulan||'-'||jurnal.tahun, 'DD-MM-YYYY') AND to_date(jurnal.hari||'-'||jurnal.bulan||'-'||jurnal.tahun, 'DD-MM-YYYY') THEN c.rupiah::NUMERIC ELSE 0::NUMERIC END)END) AS tot,
		SUM(CASE WHEN a.bawah != '' AND a.atas != '' THEN (CASE WHEN date(c.tanggal) BETWEEN to_date('1-1-'||jurnal.tahun, 'DD-MM-YYYY') AND to_date(jurnal.hari||'-'||jurnal.bulan||'-'||jurnal.tahun, 'DD-MM-YYYY') THEN c.rupiah::NUMERIC ELSE 0::NUMERIC END)END) AS tot_sd,
		a.parents, 0 as lev, a.urut
		from tbl_group_labarugi a
		LEFT JOIN tbl_jurnal c ON (to_char(c.tanggal,'YYYY')=jurnal.tahun AND c.kdperkiraan BETWEEN a.bawah AND a.atas AND c.id_proyek=jurnal.id_proyek  )
		where a.parents = 0 
		GROUP BY c.id_proyek,a.nmlama,a.gname,a.id_group,a.parents,a.urut
		ORDER BY a.urut asc
	loop
        return next results;
        for recs in 
		select jurnal.id_proyek,jurnal.tahun,jurnal.bulan,jurnal.hari, c.id_group, c.nmlama, c.gname, 
		(select count(x.id_group) from tbl_group_labarugi x where x.parents = c.id_group) as childs,
		SUM(CASE WHEN date(a.tanggal) BETWEEN to_date('1-'||jurnal.bulan||'-'||jurnal.tahun, 'DD-MM-YYYY') AND to_date(jurnal.hari||'-'||jurnal.bulan||'-'||jurnal.tahun, 'DD-MM-YYYY') THEN a.rupiah::NUMERIC ELSE 0::NUMERIC END) AS tot,
		SUM(CASE WHEN date(a.tanggal) BETWEEN to_date('1-1-'||jurnal.tahun, 'DD-MM-YYYY') AND to_date(jurnal.hari||'-'||jurnal.bulan||'-'||jurnal.tahun, 'DD-MM-YYYY') THEN a.rupiah::NUMERIC ELSE 0::NUMERIC END) AS tot_sd,
