		LEFT JOIN tbl_jurnal c ON (date(c.tanggal) <= to_date(jurnal.hari||'-'||jurnal.bulan||'-'||jurnal.tahun, 'DD-MM-YYYY') AND c.kdperkiraan BETWEEN a.bawah AND a.atas AND c.id_proyek=jurnal.id_proyek  )
		where a.parents = 0 
		GROUP BY c.id_proyek,a.nmlama,a.gname,a.id_group,a.parents,a.urut
		ORDER BY a.urut asc
	loop
        return next results;
        for recs in 
		select jurnal.id_proyek,jurnal.tahun,jurnal.bulan,jurnal.hari, c.id_group, c.nmlama, c.gname, 
		(select count(x.id_group) from tbl_group_neraca x where x.parents = c.id_group) as childs,
		SUM(CASE WHEN c.bawah != '' AND c.atas != '' THEN get_dk(a.dk) * a.rupiah::NUMERIC END) AS total,
		parents, 1 as lev, c.urut
		from tbl_group_neraca c
		LEFT JOIN tbl_jurnal a ON (date(a.tanggal) <= to_date(jurnal.hari||'-'||jurnal.bulan||'-'||jurnal.tahun, 'DD-MM-YYYY') AND a.kdperkiraan BETWEEN c.bawah AND c.atas AND a.id_proyek=jurnal.id_proyek  )
		where c.parents = results.id_group 
		GROUP BY a.id_proyek,c.nmlama,c.gname,c.id_group,c.parents, c.urut
		ORDER BY c.urut asc
	loop
            return next recs;
        end loop;
    end loop;
end loop;
return;
end;
$$;


