--
-- TOC entry 305 (class 1255 OID 1757176)
-- Name: get_nobukti(timestamp without time zone, integer, character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION get_nobukti(tanggal timestamp without time zone, id_param integer, tipe_param character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
  ret varchar := '';
  ret_type varchar := '';
  kode_param varchar := '';
  myrow RECORD;
BEGIN
	SELECT 
		INTO kode_param a.kode_proyek
	FROM 
		tbl_proyek a
	WHERE a.id_proyek = id_param;

	SELECT 
		INTO myrow mylpad(a.nilai,6,'0') 
	FROM 
		tbl_nobukti a 
	WHERE 
	LOWER(a.kode_proyek) = LOWER(kode_param) AND 
	a.tahun = to_char(tanggal,'YYYY')
	FOR UPDATE;
	IF NOT FOUND THEN
    VALUES (kode_param, to_char(tanggal,'YYYY'), 0);
	END IF;
	
	SELECT
		INTO ret_type a.confdata
	FROM configs a
	WHERE a.confname = 'app_type';

	
	SELECT 
		INTO ret mylpad(a.nilai+1,6,'0') 
	FROM 
		tbl_nobukti a
	WHERE
	LOWER(a.kode_proyek) = LOWER(kode_param) AND 
	a.tahun = to_char(tanggal,'YYYY')
	FOR UPDATE;

	UPDATE tbl_nobukti SET nilai = nilai + 1 
	WHERE 
	LOWER(kode_proyek) = LOWER(kode_param) AND 
	tahun = to_char(tanggal,'YYYY');

	RETURN UPPER(ret_type)||'/'||UPPER(COALESCE(kode_param,'-'))||'/'||UPPER(tipe_param)||'/'||ret||'/'||to_char(tanggal,'YYYY');

END;
$$;


