--

CREATE FUNCTION gethakakses(integer) RETURNS text
    LANGUAGE plpgsql
    AS $_$
	DECLARE
	ret TEXT;
	BEGIN
		select into ret
		array_to_string(ARRAY(SELECT unnest(array_agg(b.id_modules)) ORDER BY 1),';') as hak_data
		from 
		tbl_groups a
		left join tbl_akses b on b.id_group = a.id_group
		left join tbl_modules c on c.id_modules = b.id_modules
		WHERE
		a.id_group = $1;
		RETURN ret;
	END;
$_$;


