-- Name: gethakdata(boolean, integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION gethakdata(boolean, integer, integer) RETURNS text
    LANGUAGE plpgsql
    AS $_$
	DECLARE
	ret TEXT;
	BEGIN
		IF $1 = 'f' then
			SELECT 
				INTO ret
				array_to_string(ARRAY(SELECT unnest(array_agg(c.id_subunitkerja)) ORDER BY 1),';') as hak_data
			FROM 
				tbl_user a
				LEFT JOIN tbl_unitkerja b ON b.id_unitkerja = a.id_relasi
				LEFT JOIN tbl_relunitkerja c ON c.id_unitkerja = b.id_unitkerja
				LEFT JOIN tbl_subunitkerja d ON d.id_subunitkerja = c.id_subunitkerja
			WHERE
				b.id_unitkerja = $2
			GROUP BY b.id_unitkerja;
			
			RETURN ret;
		ELSE 
			SELECT INTO ret a.id_relasi FROM tbl_user a where a.user_id = $3;
			RETURN ret;
		END IF;
	END;
$_$;


