CREATE FUNCTION getledger(integer, date, date, character varying, character varying) RETURNS SETOF ledger
    LANGUAGE plpgsql
    AS $_$
DECLARE
  _IdProyek ALIAS FOR $1;
  _periode_awal ALIAS FOR $2;
  _periode_akhir ALIAS FOR $3;
  _coa_awal ALIAS FOR $4;
  _coa_akhir ALIAS FOR $5;
  _row ledger%ROWTYPE;
  _qry text := '';
  _x RECORD;
BEGIN
_qry := 'SELECT 
    proyek.id_proyek,
    proyek.kode_proyek,
    proyek.nama_proyek,
    periode.period_id,
    periode.period_name,
    periode.period_start,
    periode.period_end,
    periode.trialbal_kdperkiraan,
    periode.trialbal_beginning,
    periode.trialbal_ending,
    periode.trialbal_credits,
    periode.trialbal_debits,
    jurnal_id_jurnal,
    jurnal_tanggal,
    jurnal_nobukti,
    jurnal_kode_rekanan,
    jurnal_nama_rekanan,
    jurnal_kdsbdaya,
    jurnal_keterangan,
    jurnal_volume,
    jurnal_debet,
    jurnal_kredit,
    jurnal_coa_debet,
    jurnal_noa_debet,
    jurnal_coa_kredit,
    jurnal_noa_kredit    
FROM (
       SELECT id_proyek,
              kode_proyek,
              id_katproyek,
              id_subunitkerja,
              nama_proyek,
              proyek_jenisproyek_id,
              is_active
       FROM tbl_proyek
       WHERE ((tbl_proyek.id_proyek = '|| _IdProyek ||') and
             (tbl_proyek.is_active))
     ) as proyek,
     (
       SELECT yearperiod_id,
              yearperiod_key,
              yearperiod.id_proyek,
              yearperiod_start,
              yearperiod_end,
              yearperiod_closed,
              period_id,
              period_key,
              period_yearperiod_key,
              period_start,
              period_end,
              period_name,
              saldo.*
       FROM yearperiod,
            period
            LEFT JOIN 
            (
               SELECT trialbal_id,
                      id_proyek as trialbal_id_proyek,
                      trialbal_period_key,
                      trialbal_kdperkiraan,
                      trialbal_beginning,
                      trialbal_ending,
                      trialbal_credits,
                      trialbal_debits
               FROM trialbal
               WHERE ((trialbal.id_proyek = '|| _IdProyek ||') AND
                     (trialbal_kdperkiraan between '''|| _coa_awal ||''' AND '''|| _coa_akhir ||'''))
            ) saldo ON ((period.id_proyek = saldo.trialbal_id_proyek) AND (
            period.period_key = saldo.trialbal_period_key))
       WHERE ((yearperiod.id_proyek = '|| _IdProyek ||') AND
             (yearperiod.id_proyek = period.id_proyek) AND
             (yearperiod.yearperiod_key = period.period_yearperiod_key) AND
             (DATE (period.period_start) >= DATE ('''|| _periode_awal ||''')) AND
             (DATE (period.period_end) <= DATE ('''|| _periode_akhir ||''')))
     ) as periode
     
     LEFT JOIN (
     SELECT tbl_jurnal.id_jurnal as jurnal_id_jurnal,
       tbl_jurnal.tanggal as jurnal_tanggal,
       tbl_jurnal.nobukti as jurnal_nobukti,
       tbl_jurnal.id_proyek as jurnal_id_proyek,
       nasabah.kode_rekanan as jurnal_kode_rekanan,
       nasabah.nama_rekanan as jurnal_nama_rekanan,
       tbl_jurnal.kdsbdaya as jurnal_kdsbdaya,
       tbl_jurnal.keterangan as jurnal_keterangan,
       tbl_jurnal.volume as jurnal_volume,
       (CASE WHEN tbl_jurnal.dk = ''D'' THEN tbl_jurnal.rupiah else 0 END) AS jurnal_debet,
       (CASE WHEN tbl_jurnal.dk = ''K'' THEN (tbl_jurnal.rupiah * -1) else 0 END) AS jurnal_kredit,
       coa.kdperkiraan as jurnal_coa_debet,
       coa.nmperkiraan as jurnal_noa_debet,
       jurnal_lawan.kdperkiraan as jurnal_coa_kredit,
       jurnal_lawan.nmperkiraan as jurnal_noa_kredit
FROM tbl_jurnal
     LEFT JOIN 
     (
       SELECT kode_rekanan,
              nama_rekanan
       FROM tbl_rekanan
       WHERE id_proyek = '|| _IdProyek ||'
     ) nasabah ON (nasabah.kode_rekanan = tbl_jurnal.kdnasabah)
     LEFT JOIN tbl_dperkir coa ON (coa.kdperkiraan = tbl_jurnal.kdperkiraan)
     LEFT JOIN 
     (
       SELECT dk, 
       gid,
       coa.kdperkiraan,
       coa.nmperkiraan
       FROM tbl_jurnal
       LEFT JOIN tbl_dperkir coa ON (coa.kdperkiraan = tbl_jurnal.kdperkiraan)
       WHERE ((tbl_jurnal.id_proyek = '|| _IdProyek ||') AND
             (tbl_jurnal.isposted) AND
             (NOT tbl_jurnal.isdelete) AND
             (DATE (tbl_jurnal.tanggal) >= date ('''|| _periode_awal ||''')) AND
             (DATE (tbl_jurnal.tanggal) <= date ('''|| _periode_akhir ||''')))
     ) jurnal_lawan ON (jurnal_lawan.gid = tbl_jurnal.gid) AND (jurnal_lawan.dk != tbl_jurnal.dk)
WHERE ((tbl_jurnal.id_proyek = '|| _IdProyek ||') AND
      (tbl_jurnal.isposted) AND
      (NOT tbl_jurnal.isdelete) AND
      (DATE (tbl_jurnal.tanggal) >= date ('''|| _periode_awal ||''')) AND
      (DATE (tbl_jurnal.tanggal) <= date ('''|| _periode_akhir ||''')) AND
      (tbl_jurnal.kdperkiraan BETWEEN '''|| _coa_awal ||''' AND '''|| _coa_akhir ||'''))
     ) jurnal ON ((jurnal.jurnal_id_proyek = periode.id_proyek) AND (jurnal.jurnal_coa_debet = periode.trialbal_kdperkiraan) AND (jurnal.jurnal_coa_debet between '''|| _coa_awal ||''' AND '''|| _coa_akhir ||''') AND (date(jurnal.jurnal_tanggal) >= date(periode.period_start)) AND (date(jurnal.jurnal_tanggal) <= DATE(periode.period_end)))';

  FOR _x IN  EXECUTE _qry LOOP
    _row.ledger_id_proyek = _x.id_proyek;
    _row.ledger_kode_proyek = _x.kode_proyek;
    _row.ledger_nama_proyek = _x.nama_proyek;
    _row.ledger_period_id = _x.period_id;
    _row.ledger_period_name = _x.period_name;
    _row.ledger_period_start = _x.period_start;
    _row.ledger_period_end = _x.period_end;
    _row.ledger_trialbal_kdperkiraan = _x.trialbal_kdperkiraan;
    _row.ledger_trialbal_beginning = _x.trialbal_beginning;
    _row.ledger_trialbal_ending = _x.trialbal_ending;
    _row.ledger_trialbal_credits = _x.trialbal_credits;
    _row.ledger_trialbal_debits = _x.trialbal_debits;
    _row.ledger_id_jurnal = _x.jurnal_id_jurnal;
    _row.ledger_tanggal = _x.jurnal_tanggal;
    _row.ledger_nobukti = _x.jurnal_nobukti;
    _row.ledger_kode_rekanan = _x.jurnal_kode_rekanan;
    _row.ledger_nama_rekanan = _x.jurnal_nama_rekanan;
    _row.ledger_kdsbdaya = _x.jurnal_kdsbdaya;
    _row.ledger_keterangan = _x.jurnal_keterangan;
    _row.ledger_volume = _x.jurnal_volume;
    _row.ledger_debet = _x.jurnal_debet;
    _row.ledger_kredit = _x.jurnal_kredit;
    _row.ledger_coa_debet = _x.jurnal_coa_debet;
    _row.ledger_noa_debet = _x.jurnal_noa_debet;
    _row.ledger_coa_kredit = _x.jurnal_coa_kredit;
    _row.ledger_noa_kredit = _x.jurnal_noa_kredit;  
RETURN NEXT _row;
  END LOOP;
  RETURN ;
END;
$_$;


