--
-- TOC entry 312 (class 1255 OID 1757182)
-- Name: getledgerrekanan(integer, integer, integer, character varying, character varying, character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION getledgerrekanan(integer, integer, integer, character varying, character varying, character varying) RETURNS SETOF gledger
    LANGUAGE plpgsql
    AS $_$
DECLARE  
  _IdProyek ALIAS FOR $1;  
  _Idperiode_awal ALIAS FOR $2;  
  _Idperiode_akhir ALIAS FOR $3;
  _KodeRekanan ALIAS FOR $4;  
  _coa_awal ALIAS FOR $5;  
  _coa_akhir ALIAS FOR $6;  
  _row gledger % ROWTYPE;  
  _periode_awal RECORD;  
  _periode_akhir RECORD;  
  _saldo RECORD;  
  _x RECORD;  
  _y RECORD;  
  _z RECORD;  
  _nomor INTEGER;
BEGIN
/* Set Variable _periode_awal */
  SELECT period_id,
         period_name,
         period_start,
         period_end
  INTO _periode_awal
  FROM period
  WHERE ((period.id_proyek = _IdProyek) AND
        (period_id = _Idperiode_awal));

/* Set Variable _periode_akhir */     
  SELECT period_id,
         period_name,
         period_start,
         period_end
  INTO _periode_akhir
  FROM period
  WHERE ((period.id_proyek = _IdProyek) AND
        (period_id = _Idperiode_akhir));
        
/* Perulangan Record Kode Perkiraan */
  FOR _x IN
    SELECT kdperkiraan
    FROM tbl_dperkir
    WHERE (kdperkiraan BETWEEN _coa_awal AND _coa_akhir)
    ORDER BY kdperkiraan ASC
  LOOP
	FOR _y IN
      SELECT period_id,
             period_name,
             period_start,
             period_end
      FROM period
      WHERE ((period.id_proyek = _IdProyek) AND
            (period_start >= _periode_awal.period_start) AND
            (period_start <= _periode_akhir.period_end))
      ORDER BY period_start ASC
    LOOP
    /* mengambil nilai saldo per periode*/
      SELECT yearperiod_id,
            yearperiod_key,
            yearperiod.id_proyek,
            yearperiod_start,
            yearperiod_end,
            yearperiod_closed,
            period_id,
            period_key,
            period_yearperiod_key,
            period_start,
            period_end,
            period_name,
            saldo.*
      INTO _saldo
      FROM yearperiod,
          period
          LEFT JOIN 
          (
            SELECT saldo_perekanan_id,
                   saldo_perekanan_id_proyek,
                   saldo_perekanan_period_key,
                   saldo_perekanan_kdperkiraan,
                   saldo_perekanan_beginning,
                   saldo_perekanan_ending,
                   saldo_perekanan_credits,
                   saldo_perekanan_debits
            FROM saldo_perekanan a
            WHERE ((a.saldo_perekanan_id_proyek = _IdProyek) AND
                  (a.saldo_perekanan_kode_rekanan = _KodeRekanan) AND
                  (a.saldo_perekanan_kdperkiraan = _x.kdperkiraan)) 
          ) saldo ON ((period.id_proyek = saldo.saldo_perekanan_id_proyek) AND (period.period_key = saldo.saldo_perekanan_period_key))
      WHERE ((yearperiod.id_proyek = _IdProyek) AND
           (yearperiod.id_proyek = period.id_proyek) AND
           (yearperiod.yearperiod_key = period.period_yearperiod_key) AND
           (period.period_id = _y.period_id));
        
      _row.gledger_nomor = '';
      _row.gledger_tanggal = '';
      _row.gledger_no_bukti = '';
      _row.gledger_rekanan = '';
      _row.gledger_uraian = _x.kdperkiraan || ' ' || _y.period_name;
      _row.gledger_coa = '';
      _row.gledger_debet = '';
      _row.gledger_kredit = '';
      RETURN NEXT _row;
      
      _row.gledger_nomor = '';
      _row.gledger_tanggal = '';
      _row.gledger_no_bukti = '';
      _row.gledger_rekanan = '';
      _row.gledger_uraian = 'Saldo Awal';
      _row.gledger_coa = '';
      _row.gledger_debet = COALESCE(_saldo.saldo_perekanan_beginning,0);
      _row.gledger_kredit = '';
      RETURN NEXT _row;
      
      /* mengambil jurnal yang berhubungan dengan kode rekanan*/
      _nomor := 1;
      FOR _z IN
        SELECT tbl_jurnal.id_jurnal AS jurnal_id_jurnal,
               tbl_jurnal.tanggal AS jurnal_tanggal,
               tbl_jurnal.nobukti AS jurnal_nobukti,
               tbl_jurnal.id_proyek AS jurnal_id_proyek,
               nasabah.kode_rekanan AS jurnal_kode_rekanan,
               nasabah.nama_rekanan AS jurnal_nama_rekanan,
               tbl_jurnal.kdsbdaya AS jurnal_kdsbdaya,
               tbl_jurnal.keterangan AS jurnal_keterangan,
               tbl_jurnal.volume AS jurnal_volume,
               (CASE WHEN tbl_jurnal.dk = 'D' THEN tbl_jurnal.rupiah ELSE 0 END) AS jurnal_debet,
               (CASE WHEN tbl_jurnal.dk = 'K' THEN (tbl_jurnal.rupiah * - 1) ELSE 0 END) AS jurnal_kredit,
               coa.kdperkiraan AS jurnal_coa_debet,
               coa.nmperkiraan AS jurnal_noa_debet,
               jurnal_lawan.kdperkiraan as jurnal_coa_kredit,
               jurnal_lawan.nmperkiraan as jurnal_noa_kredit
        FROM tbl_jurnal
             LEFT JOIN 
             (
                SELECT kode_rekanan, nama_rekanan
                FROM tbl_rekanan
                WHERE ((id_proyek = _IdProyek) AND
                      (kode_rekanan = _KodeRekanan))
             ) nasabah ON (nasabah.kode_rekanan = tbl_jurnal.kdnasabah)
             LEFT JOIN tbl_dperkir coa ON (coa.kdperkiraan = tbl_jurnal.kdperkiraan)
             LEFT JOIN 
             (
                SELECT dk, gid, coa.kdperkiraan, coa.nmperkiraan
                FROM tbl_jurnal
                    LEFT JOIN tbl_dperkir coa ON (coa.kdperkiraan = tbl_jurnal.kdperkiraan)
                WHERE ((tbl_jurnal.id_proyek = _IdProyek) AND
                     (tbl_jurnal.isposted) AND
                     (NOT tbl_jurnal.isdelete) AND
                     (DATE (tbl_jurnal.tanggal) >= date (_y.period_start)) AND
                     (DATE (tbl_jurnal.tanggal) <= date (_y.period_end)))
             ) jurnal_lawan ON (jurnal_lawan.gid = tbl_jurnal.gid) AND (jurnal_lawan.dk != tbl_jurnal.dk)
        WHERE ((tbl_jurnal.id_proyek = _IdProyek) AND
              (tbl_jurnal.isposted) AND
              (NOT tbl_jurnal.isdelete) AND
              (DATE (tbl_jurnal.tanggal) >= date (_y.period_start)) AND
              (DATE (tbl_jurnal.tanggal) <= date (_y.period_end)) AND
              (tbl_jurnal.kdperkiraan = _x.kdperkiraan) AND
              (tbl_jurnal.kdnasabah = _KodeRekanan))
      LOOP
          _row.gledger_nomor = _nomor;
          _row.gledger_tanggal = _z.jurnal_tanggal;
          _row.gledger_no_bukti = _z.jurnal_nobukti;
          _row.gledger_rekanan = _z.jurnal_kode_rekanan;
          _row.gledger_uraian = _z.jurnal_keterangan;
          _row.gledger_coa = _z.jurnal_coa_kredit;
          _row.gledger_debet = COALESCE(_z.jurnal_debet,0);
          _row.gledger_kredit = COALESCE(_z.jurnal_kredit,0);
          _nomor := _nomor + 1;
          RETURN NEXT _row;
      END LOOP;
      
      _row.gledger_nomor = '';
      _row.gledger_tanggal = '';
      _row.gledger_no_bukti = '';
      _row.gledger_rekanan = '';
      _row.gledger_uraian = 'Sub Total';
      _row.gledger_coa = '';
      _row.gledger_debet = COALESCE(_saldo.saldo_perekanan_debits,0);
      _row.gledger_kredit = COALESCE(_saldo.saldo_perekanan_credits,0);
      RETURN NEXT _row;
      
      _row.gledger_nomor = '';
      _row.gledger_tanggal = '';
      _row.gledger_no_bukti = '';
      _row.gledger_rekanan = '';
      _row.gledger_uraian = 'Saldo Akhir';
      _row.gledger_coa = '';
      _row.gledger_debet = COALESCE(_saldo.saldo_perekanan_ending,0);
      _row.gledger_kredit = '';
      RETURN NEXT _row;
      
      _row.gledger_nomor = '';
      _row.gledger_tanggal = '';
      _row.gledger_no_bukti = '';
      _row.gledger_rekanan = '';
      _row.gledger_uraian = '';
      _row.gledger_coa = '';
      _row.gledger_debet = '';
      _row.gledger_kredit = '';
      RETURN NEXT _row;
    END LOOP;
  END LOOP;
  RETURN;
END;
$_$;


