--

CREATE FUNCTION getperiodid(date, integer) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
-- Copyright (c) 1999-2012 by OpenMFG LLC, d/b/a xTuple. 
-- See www.xtuple.com/CPAL for the full text of the software license.
DECLARE
  pPeriodDate ALIAS FOR $1;
  pProyek ALIAS FOR $2;
  _returnVal INTEGER;
BEGIN
  IF (pPeriodDate IS NULL) THEN
    RETURN -1;
  END IF;
  
  SELECT period_id INTO _returnVal
  FROM period
  WHERE (date((pPeriodDate)) between date(period_start) AND date(period_end)) AND id_proyek = pProyek;

  IF (_returnVal IS NULL) THEN
    RETURN -2;
  END IF;

  RETURN _returnVal;
END;
$_$;


