CREATE FUNCTION ins_function() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
	each_column RECORD;
	new_id_proyek INTEGER;
	new_bulan INTEGER;
	new_tahun INTEGER;
	new_kdperkiraan TEXT;
	rtn INTEGER;
	new_tanggal timestamp;
	saldo double precision; 
BEGIN
	new_id_proyek := NEW.id_proyek;
	new_kdperkiraan := NEW.kdperkiraan;
	new_tahun := DATE_PART('YEAR', NEW.tanggal);
	new_bulan := DATE_PART('MONTH', NEW.tanggal);
	new_tanggal := to_char(NEW.tanggal, 'YYYY-MM-DD');

	IF tg_op = 'INSERT' THEN
		select a.id_saldo
		from tbl_saldo a
		where a.id_proyek = new_id_proyek and a.kodeperkiraan = new_kdperkiraan and a.tahun = new_tahun and a.bulan = new_bulan INTO rtn;
		
		IF NOT FOUND THEN
			select 
			(sum(a.debet) - sum(a.kredit)) as sisa
			from
			(
			SELECT jur.kdperkiraan,
				   (CASE WHEN upper(jur.dk) = 'D' THEN SUM(rupiah) else 0 END) AS debet,
				   (CASE WHEN upper(jur.dk) = 'K' THEN SUM(rupiah) else 0 END) AS kredit
			FROM tbl_jurnal jur
			WHERE 
				 date_part('MONTH',jur.tanggal) <= new_bulan AND
				 date_part('YEAR',jur.tanggal) = new_tahun AND
				  jur.id_proyek = new_id_proyek AND 
				  jur.kdperkiraan = new_kdperkiraan
			GROUP BY jur.kdperkiraan,
					 jur.dk
			) as a into saldo;

			RETURN NEW;
		ELSE
			RETURN NEW;
		END IF;	
	END IF;
	
END
$$;


