CREATE FUNCTION jurnal_child_create(date, date, integer, integer) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
DECLARE
	pStartDate ALIAS FOR $1;
	pEndDate ALIAS FOR $2;
	IdProyek ALIAS FOR $3;
	PeriodeKey ALIAS FOR $4;
	_check INTEGER;
	_tablename character varying;
BEGIN
_tablename:='tbl_jurnal'||'_'||IdProyek||'_'||PeriodeKey;

SELECT table_name INTO _check
FROM information_schema.tables
WHERE table_name = _tablename;

IF (FOUND) THEN
	RETURN -1;
END IF;

EXECUTE '
CREATE TABLE ' || _tablename || ' (
	PRIMARY KEY (id_jurnal), 
	CHECK ( tanggal >= DATE('''|| pStartDate ||'''::date) AND tanggal < DATE('''|| pEndDate ||'''::date))
) INHERITS (tbl_jurnal)';

return 1;
END;
$_$;


