CREATE FUNCTION jurnal_child_insert(integer, date, character varying, character varying, integer, character varying, character varying, text, numeric, character varying, double precision, integer, timestamp without time zone, character varying, integer, timestamp without time zone, character varying, integer, boolean, boolean, integer, character varying) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
DECLARE
  _id_jurnal 		ALIAS FOR $1;
  _tanggal 		ALIAS FOR $2;
  _nobukti 		ALIAS FOR $3;
  _kdperkiraan 		ALIAS FOR $4;
  _id_proyek 		ALIAS FOR $5;
  _kdnasabah 		ALIAS FOR $6;
  _kdsbdaya 		ALIAS FOR $7;
  _keterangan 		ALIAS FOR $8;
  _volume 		ALIAS FOR $9;
  _dk 			ALIAS FOR $10;
  _rupiah 		ALIAS FOR $11;
  _create_id 		ALIAS FOR $12;
  _create_time 		ALIAS FOR $13;
  _create_ip 		ALIAS FOR $14;
  _modify_id 		ALIAS FOR $15;
  _modify_time 		ALIAS FOR $16;
  _modify_ip 		ALIAS FOR $17;
  _gid 			ALIAS FOR $18;
  _isposted 		ALIAS FOR $19;
  _isdelete		ALIAS FOR $20;
  _jenisjurnal_id	ALIAS FOR $21;
  _TableName 		ALIAS FOR $22;
  _qry  		TEXT := '';
  _val			TEXT := '';
  _query		TEXT := '';
BEGIN
	_qry := 'INSERT INTO '|| _TableName ||' ';
	_qry := _qry || '(id_jurnal, tanggal, nobukti, kdperkiraan';
	
	_val := 'VALUES (';
	_val := _val || _id_jurnal || ', ';
	_val := _val || '''' || _tanggal || ''', ';
	_val := _val || '''' || _nobukti || ''', ';
	_val := _val || '''' || _kdperkiraan || '''';
	
	IF (_id_proyek IS NOT NULL) THEN
		_qry := _qry || ', id_proyek'; 
		_val := _val || ',' || _id_proyek || ' ';
	END IF;
	
	IF (_kdnasabah IS NOT NULL OR _kdnasabah <> '') THEN
		_qry := _qry || ', kdnasabah';
		_val := _val || ',''' || _kdnasabah || '''';
	END IF;
	
	IF (_kdsbdaya IS NOT NULL OR _kdsbdaya <> '') THEN
