		_val := _val || ',''' || _dk || '''';
	END IF;
	
	IF (_rupiah IS NOT NULL) THEN
		_qry := _qry || ', rupiah';
		_val := _val || ',' || _rupiah || ' ';
	END IF;
	
	IF (_create_id IS NOT NULL) THEN
		_qry := _qry || ', create_id';
		_val := _val || ',' || _create_id || ' ';
