	END IF;
	
	IF (_modify_ip IS NOT NULL OR _modify_ip <> '') THEN
		_qry := _qry || ', modify_ip';
		_val := _val || ',''' || _modify_ip || '''';
	END IF;
	
	IF (_gid IS NOT NULL) THEN
		_qry := _qry || ', gid';
		_val := _val || ',' || _gid;
	END IF;
	
	IF (_isposted IS NOT NULL) THEN
		_qry := _qry || ', isposted';
		_val := _val || ',' || _isposted || ' ';
	END IF;
	
	IF (_isdelete IS NOT NULL) THEN
		_qry := _qry || ', isdelete';
		_val := _val || ',' || _isdelete || ' ';
	END IF;
	
	IF (_jenisjurnal_id IS NOT NULL) THEN
		_qry := _qry || ', jenisjurnal_id';
		_val := _val || ',' || _jenisjurnal_id || ' ';
	END IF;
	_qry := _qry || ')';
	_val := _val || ')';
	_query := _qry || _val;
	EXECUTE _query;
RETURN 1;
END;
$_$;


