--
-- TOC entry 320 (class 1255 OID 1757189)
-- Name: periodclose(integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION periodclose(integer, integer) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
DECLARE
    pPeriodid ALIAS FOR $1;
    IdProyek ALIAS FOR $2;
    _r RECORD;
    _period_key INTEGER;
    _nextperiod_key INTEGER;
    _nextPeriodid INTEGER;
    _trialbalid INTEGER;
    _ending NUMERIC;
    _currYear INTEGER;
    _nextYear INTEGER;
BEGIN

--  Bypass error checking is this the the initial period
  IF ( NOT ( SELECT period_initial
             FROM period
             WHERE ((period_id=pPeriodid)
             AND (id_proyek = IdProyek)) ) ) THEN

--  Check to make use that the period is not already closed
    IF ( ( SELECT period_closed
           FROM period
           WHERE ((period_id=pPeriodid)
           AND (id_proyek=IdProyek)) ) ) THEN
      RETURN -1;
    END IF;

--  Make sure that the day before this period belongs to another period
    SELECT prev.period_id AS periodid, prev.period_closed AS closed, prev.period_key AS periodkey INTO _r
    FROM period AS prev, period AS curr
    WHERE ( (prev.period_end <= (curr.period_start - 1))
    AND (curr.period_id=pPeriodid) 
    AND (prev.id_proyek=curr.id_proyek))
    ORDER BY prev.period_id DESC LIMIT 1;

    IF (NOT FOUND) THEN
      RETURN -2;
    END IF;

--  Make sure that the previous period is closed
    IF (NOT _r.closed) THEN
      RETURN -3;
    END IF;

  END IF;

--  Make sure that there the next period is defined
    SELECT next.period_id INTO _nextPeriodid
    FROM period AS next, period AS curr
    WHERE ((next.period_start >= (curr.period_end + 1))
    and (curr.period_id=pPeriodid) 
    AND (next.id_proyek=curr.id_proyek))
    ORDER BY next.period_id ASC LIMIT 1;
        
  IF (NOT FOUND) THEN
    RETURN -4;
  END IF;

--  Make sure that the user is not trying to prematurely close the Period
  IF ( ( SELECT (period_end >= CURRENT_DATE)
         FROM period
         WHERE (period_id=pPeriodid) ) ) THEN
    RETURN -5;
  END IF;

  SELECT yearperiod_id INTO _currYear
    FROM yearperiod, period
   WHERE ((period_end BETWEEN yearperiod_start and yearperiod_end)
     AND  (period_id=pPeriodid)
     AND (yearperiod.id_proyek = IdProyek));
  IF (NOT FOUND) THEN
    _currYear := -1;
  END IF;

  SELECT yearperiod_id INTO _nextYear
    FROM yearperiod, period
   WHERE ((period_end BETWEEN yearperiod_start and yearperiod_end)
     AND  (period_id=_nextPeriodid)
     AND (yearperiod.id_proyek = IdProyek));
  IF (NOT FOUND) THEN
    RETURN -6;
  END IF;

--  Walk through the entire COA, calculating the ending balance and pushing
--  it to the beginning balance for the next period
SELECT period_key FROM period INTO _period_key WHERE period_id = pPeriodid;
SELECT period_key FROM period INTO _nextperiod_key WHERE period_id = _nextPeriodid;
FOR _r IN 
    select a.kdperkiraan,
           a.nmperkiraan,
           b.trialbal_id,
           b.id_proyek,
           b.trialbal_beginning,
           b.trialbal_credits,
           b.trialbal_debits
    from tbl_dperkir a
         left join trialbal b on ((a.kdperkiraan = b.trialbal_kdperkiraan) 
         AND (b.id_proyek = IdProyek)
         AND (trialbal_period_key=_period_key))
    order by a.kdperkiraan asc LOOP
        
    IF (_r.trialbal_id IS NULL) THEN
        _ending = 0;
            id_proyek, trialbal_period_key, trialbal_kdperkiraan, 
            trialbal_beginning, trialbal_ending, trialbal_credits, trialbal_debits, 
            trialbal_dirty)
        VALUES (IdProyek, _period_key, _r.kdperkiraan, 0, 0, 0, 0, FALSE);
    ELSE
	    _ending = (_r.trialbal_beginning + (_r.trialbal_debits - _r.trialbal_credits));
        UPDATE trialbal
        SET trialbal_ending=_ending,
        trialbal_dirty = FALSE
        WHERE (trialbal_id=_r.trialbal_id);
         PERFORM trialbalanceforwardupdate(_r.trialbal_id, IdProyek);
    END IF;
    
    
    IF (_currYear != _nextYear) THEN
      _ending := 0;
    END IF;

--  Find the trialbal record for the next period
    SELECT trialbal_id INTO _trialbalid
    FROM trialbal
    WHERE ( (trialbal_period_key=_nextperiod_key)
     AND (trialbal_kdperkiraan=_r.kdperkiraan) );
     
    IF (FOUND) THEN
      UPDATE trialbal
      SET trialbal_beginning = (_ending + trialbal_yearend),
          trialbal_ending = (_ending + trialbal_yearend - trialbal_debits + trialbal_credits)
      WHERE (trialbal_id=_trialbalid);
    ELSE
            id_proyek, trialbal_period_key, trialbal_kdperkiraan, 
            trialbal_beginning, trialbal_ending, trialbal_credits, trialbal_debits, 
            trialbal_dirty)
        VALUES (IdProyek, _nextperiod_key, _r.kdperkiraan, _ending, _ending, 0, 0, FALSE);
    END IF;
    
END LOOP;

--  Set the period_closed flag
  UPDATE period
  SET period_closed=TRUE
  WHERE ((period_id=pPeriodid) AND (id_proyek=IdProyek));

  RETURN pPeriodid;

END;
$_$;


