CREATE FUNCTION saldo_perekananforwardupdate(integer, integer, character varying) RETURNS void
    LANGUAGE plpgsql
    AS $_$
DECLARE
  IdSaldo ALIAS FOR $1;
  IdProyek ALIAS FOR $2;
  KodeRekanan ALIAS FOR $3;
  _p RECORD;
  _r RECORD;
  _ending NUMERIC;
  _prevYear INTEGER;
  _currYear INTEGER;
  _prevYearClosed BOOLEAN;
  _currYearClosed BOOLEAN;
  _result INTEGER;
BEGIN
  SELECT
    saldo_perekanan_kdperkiraan,
    saldo_perekanan_kode_rekanan,
    saldo_perekanan_ending,
    yearperiod_id,
    yearperiod_closed,
    period_end
  INTO _p
  FROM
    saldo_perekanan,
    period,
    yearperiod,
    tbl_dperkir
  WHERE
    ((saldo_perekanan_period_key = period_key) AND
    (yearperiod_key = period_yearperiod_key) AND
    (saldo_perekanan_kdperkiraan = kdperkiraan) AND
    (saldo_perekanan_id = IdSaldo) AND
    (saldo_perekanan_id_proyek = IdProyek));

  _ending = _p.saldo_perekanan_ending;

    SELECT yearperiod_id, yearperiod_closed
    INTO _prevYear, _prevYearClosed
    FROM yearperiod
    WHERE ((_p.period_end BETWEEN yearperiod_start AND yearperiod_end) AND
    (id_proyek = IdProyek));

    IF (NOT FOUND) THEN
        _prevYear := -1;
        _prevYearClosed := false;
    END IF;

    FOR _r IN
        SELECT period_id,
               period_key,
               period_end,
               saldo_perekanan_id,
               saldo_perekanan_kdperkiraan,
               saldo_perekanan_kode_rekanan,
               saldo_perekanan_debits,
               saldo_perekanan_credits,
               saldo_perekanan_yearend,
               saldo_perekanan_id_proyek
        FROM period
             LEFT OUTER JOIN saldo_perekanan ON (
             (saldo_perekanan_period_key = period_key) AND 
             (saldo_perekanan_kdperkiraan = _p.saldo_perekanan_kdperkiraan) AND
             (saldo_perekanan_kode_rekanan = _p.saldo_perekanan_kode_rekanan)
             )
        WHERE ((period_start > _p.period_end) AND
              (period.id_proyek = IdProyek))
        ORDER BY date(period_start) ASC
    LOOP
        IF (_r.saldo_perekanan_id IS NULL) THEN
                        saldo_perekanan_kode_rekanan,
                        saldo_perekanan_period_key, saldo_perekanan_kdperkiraan, 
                        saldo_perekanan_beginning, saldo_perekanan_ending,
                        saldo_perekanan_debits, saldo_perekanan_credits, 
                        saldo_perekanan_dirty, saldo_perekanan_id_proyek)
            VALUES (KodeRekanan, _r.period_key, _p.saldo_perekanan_kdperkiraan, _ending, _ending, 0, 0, FALSE, IdProyek);
        ELSE
            UPDATE saldo_perekanan
            SET saldo_perekanan_beginning =(_ending + saldo_perekanan_yearend),
            saldo_perekanan_ending =(_ending + saldo_perekanan_yearend + (_r.saldo_perekanan_debits - _r.saldo_perekanan_credits)),
            saldo_perekanan_dirty = FALSE
            WHERE (saldo_perekanan_id = _r.saldo_perekanan_id);
                
            _ending = (_ending + _r.saldo_perekanan_yearend + (_r.saldo_perekanan_debits - _r.saldo_perekanan_credits));
        END IF;
    END LOOP;
  
        UPDATE saldo_perekanan
        SET saldo_perekanan_dirty = FALSE
        WHERE (saldo_perekanan_id=IdSaldo);
