--
-- TOC entry 326 (class 1255 OID 1757197)
-- Name: seq_nobukti_get(timestamp without time zone, integer, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION seq_nobukti_get(timestamp without time zone, integer, text) RETURNS character varying
    LANGUAGE plpgsql
    AS $_$
DECLARE
  Tanggal ALIAS FOR $1;
  IdProyek ALIAS FOR $2;
  TipeTrans ALIAS FOR $3;
  _r RECORD;
  _rec RECORD;
  _KodeProyek character varying;
  _TypeApp text;
BEGIN

SELECT a.period_id,
       a.period_closed,
       a.period_freeze
INTO _r
FROM period a
WHERE ((Tanggal::timestamp without time zone BETWEEN a.period_start::date AND a.period_end::date) 
      AND (a.id_proyek = IdProyek));

IF (NOT FOUND) THEN
RETURN 'A';
END IF;

IF (_r.period_closed) THEN
RETURN 'B';
END IF;

SELECT a.kode_proyek
INTO _KodeProyek
FROM tbl_proyek a
WHERE a.id_proyek = IdProyek;    

SELECT a.confdata
INTO _TypeApp 
FROM configs a
WHERE a.confname = 'app_type';
  
SELECT seq_nobukti_id, seq_nobukti_id_proyek, seq_nobukti_year, seq_nobukti_month, seq_nobukti_value,
       mylpad(COALESCE(seq_nobukti_value,0)::bigint, 4, '0') as nilai
INTO _rec
FROM seq_nobukti
WHERE ((seq_nobukti_year::numeric = to_char(Tanggal ::timestamp without time zone, 'YYYY') ::numeric) AND
      (seq_nobukti_month::numeric = to_char(Tanggal ::timestamp without time zone, 'MM') ::numeric) AND
      (seq_nobukti_id_proyek = IdProyek));
      
IF (NOT FOUND) THEN
    VALUES (IdProyek, 
    to_char(Tanggal ::timestamp without time zone, 'YYYY') ::numeric, 
    to_char(Tanggal ::timestamp without time zone, 'MM') ::numeric, 
    1);
    
    RETURN UPPER(_TypeApp)||'/'||UPPER(COALESCE(_KodeProyek,'-'))||'/'||UPPER(TipeTrans)||'/'||mylpad(1,4,'0')||'/'||trim(both from to_char((to_char(Tanggal::timestamp with time zone, 'MM'::text))::numeric,'RN')::text)||'/'||to_char(Tanggal,'YYYY');
ELSE
    UPDATE seq_nobukti
    SET seq_nobukti_value = _rec.seq_nobukti_value + 1
    WHERE seq_nobukti_id = _rec.seq_nobukti_id;
    
    RETURN UPPER(_TypeApp)||'/'||UPPER(COALESCE(_KodeProyek,'-'))||'/'||UPPER(TipeTrans)||'/'||_rec.nilai||'/'||trim(both from to_char((to_char(Tanggal::timestamp with time zone, 'MM'::text))::numeric,'RN')::text)||'/'||to_char(Tanggal,'YYYY');
END IF;

END;
$_$;


