--
-- TOC entry 347 (class 1255 OID 1794303)
-- Name: tempjurnal_approve(integer, integer, text[]); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION tempjurnal_approve(integer, integer, text[]) RETURNS SETOF approv_jurnal
    LANGUAGE plpgsql
    AS $_$
DECLARE
  _IdProyek ALIAS FOR $1;
  _UserId ALIAS FOR $2;
  _NoBukti ALIAS FOR $3;
  _row approv_jurnal % ROWTYPE;
  _initial BOOLEAN;
  _x RECORD;
  _y RECORD;
  _z RECORD;
BEGIN
  FOR _x IN
EXECUTE
'SELECT
tanggal,
nobukti,
is_approved
FROM
tbl_tempjurnal
WHERE
(id_proyek = '    || _IdProyek || ') AND
(NOT is_delete) AND
(nobukti IN (''' || ARRAY_TO_STRING(_NoBukti, ''', ''') || '''))
GROUP BY
nobukti,
tanggal,
is_approved
ORDER BY
DATE (tanggal) ASC'
  LOOP

    IF(NOT _x.is_approved) THEN
      select
        period.period_closed
      into _initial
      from
        period
      where
        (period.id_proyek = _IdProyek) and
        (date (_x.tanggal) between date (period.period_start) and
        date (period.period_end));

      IF(_initial) THEN
        _row.approv_jurnal_nobukti = _x.nobukti;
        _row.approv_jurnal_gid = -1;
        _row.approv_tempjurnal_gid = -1;
        _row.approv_jurnal_status = 'Gagal';
        _row.approv_jurnal_keterangan = 'Periode Telah Di Tutup';
        ELSE

        FOR _y IN
        SELECT
          nobukti,
          gid
        FROM
          tbl_tempjurnal
        WHERE
          ((nobukti = _x.nobukti) AND
          (id_proyek = _IdProyek))
        GROUP BY
          nobukti,
          gid
        LOOP

          FOR _z IN
          SELECT
            id_tempjurnal,
            tanggal,
            nobukti,
            kdperkiraan,
            id_proyek,
            kdnasabah,
            kdsbdaya,
            keterangan,
            volume,
            dk,
            rupiah,
            gid,
            tempjurnal_jenisjurnal_id
          FROM
            tbl_tempjurnal
          WHERE
            (gid = _y.gid) AND
            (id_proyek = _IdProyek)
          LOOP
            VALUES (_z.tanggal, _z.nobukti, _z.kdperkiraan, _z.id_proyek, _z.kdnasabah, _z.kdsbdaya, _z.keterangan, _z.volume, _z.dk, _z.rupiah, _UserId, _z.gid, _z.tempjurnal_jenisjurnal_id);
            UPDATE tbl_tempjurnal
            SET is_approved = TRUE
            WHERE id_proyek = _IdProyek and gid = _z.gid;
          END LOOP;
          PERFORM trialbalancepostinto(_y.gid, _IdProyek);
        END LOOP;

        _row.approv_jurnal_nobukti = _x.nobukti;
        _row.approv_jurnal_gid = -1;
        _row.approv_tempjurnal_gid = -1;
        _row.approv_jurnal_status = 'Berhasil';
        _row.approv_jurnal_keterangan = 'Jurnal Berhasil Diapprov';

      END IF;

      ELSE
      _row.approv_jurnal_nobukti = _x.nobukti;
      _row.approv_jurnal_gid = -1;
      _row.approv_tempjurnal_gid = -1;
      _row.approv_jurnal_status = 'Gagal';
      _row.approv_jurnal_keterangan = 'Jurnal Telah Diapprov';
    END IF;

    RETURN NEXT _row;
  END LOOP;
  RETURN;
END;
$_$;


