--
-- TOC entry 346 (class 1255 OID 1791485)
-- Name: trialbalancepostinto(integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION trialbalancepostinto(integer, integer) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
DECLARE
pSequence ALIAS FOR $1;
IdProyek ALIAS FOR $2;
_trialbalid INTEGER;
_saldorekananid INTEGER;
_r RECORD;
BEGIN
	FOR _r IN 
		SELECT *
		FROM 
		period b,
		tbl_jurnal a
		LEFT JOIN tbl_proyek c ON ((c.id_proyek = a.id_jurnal) and (c.id_proyek=IdProyek))
		WHERE
		((NOT a.isposted) and
		(NOT a.isdelete) and
		(b.id_proyek = IdProyek) AND
		(date(a.tanggal) BETWEEN date(b.period_start) and date(b.period_end)) and
		(a.gid=pSequence)) LOOP
		
			IF ( (NOT _r.period_closed) ) THEN    
				SELECT trialbal_id
				INTO _trialbalid
				FROM trialbal
				WHERE ((trialbal_period_key = _r.period_key) AND
				(trialbal_kdperkiraan = _r.kdperkiraan) AND
				(trialbal.id_proyek = IdProyek));

				IF (FOUND) THEN
					IF (lower(_r.dk) = 'k') THEN
						UPDATE trialbal
						SET trialbal_credits = (trialbal_credits + (_r.rupiah * -1))
						WHERE (trialbal_id=_trialbalid);
					ELSE
						UPDATE trialbal
						SET trialbal_debits = (trialbal_debits + _r.rupiah)
						WHERE (trialbal_id=_trialbalid);
					END IF;

					UPDATE trialbal
					SET trialbal_ending = (trialbal_beginning + (trialbal_debits - trialbal_credits)),
					trialbal_dirty=TRUE
					WHERE (trialbal_id=_trialbalid);

				ELSE
					SELECT NEXTVAL('trialbal_trialbal_id_seq') INTO _trialbalid;
					trialbal_id, id_proyek, trialbal_period_key, trialbal_kdperkiraan, 
					trialbal_beginning, trialbal_dirty,
					trialbal_ending, 
					trialbal_credits, 
					trialbal_debits
					)
					VALUES 
					(_trialbalid, IdProyek, _r.period_key, _r.kdperkiraan, 
					0, TRUE,
					_r.rupiah,
					CASE WHEN (lower(_r.dk) = 'k') THEN (_r.rupiah * -1) ELSE 0 END,
					CASE WHEN (lower(_r.dk) = 'd') THEN _r.rupiah ELSE 0 END );
				END IF; 

			/* awal  */
				IF(_r.kdnasabah != '') THEN
					SELECT saldo_perekanan_id
					FROM saldo_perekanan a
					INTO _saldorekananid
					WHERE ((saldo_perekanan_kdperkiraan = _r.kdperkiraan) AND
					(saldo_perekanan_kode_rekanan = _r.kdnasabah) AND
					(saldo_perekanan_period_key = _r.period_key) AND
					(saldo_perekanan_id_proyek = IdProyek));

					IF(FOUND) THEN
						IF (lower(_r.dk) = 'k') THEN    
							UPDATE saldo_perekanan
							SET saldo_perekanan_credits=(saldo_perekanan_credits + (_r.rupiah * -1))
							WHERE (saldo_perekanan_id = _saldorekananid);
						ELSE
							UPDATE saldo_perekanan
							SET saldo_perekanan_debits=(saldo_perekanan_debits + _r.rupiah)
							WHERE (saldo_perekanan_id = _saldorekananid);
						END IF;

						UPDATE saldo_perekanan
						SET saldo_perekanan_ending = (saldo_perekanan_beginning + (saldo_perekanan_debits - saldo_perekanan_credits)),
						saldo_perekanan_dirty=TRUE
						WHERE (saldo_perekanan_id=_saldorekananid);
					ELSE
						SELECT NEXTVAL('saldo_perekanan_saldo_perekanan_id_seq') INTO _saldorekananid;
						saldo_perekanan_id, 
						saldo_perekanan_id_proyek, 
						saldo_perekanan_period_key, 
						saldo_perekanan_kdperkiraan, 
						saldo_perekanan_kode_rekanan, 
						saldo_perekanan_beginning, 
						saldo_perekanan_ending, 
						saldo_perekanan_credits, 
						saldo_perekanan_debits, 
						saldo_perekanan_dirty)
						VALUES (_saldorekananid, 
						IdProyek, 
						_r.period_key, 
						_r.kdperkiraan, 
						_r.kdnasabah, 
						0, 
						_r.rupiah, 
						CASE WHEN (lower(_r.dk) = 'k') THEN (_r.rupiah * -1) ELSE 0 END,
						CASE WHEN (lower(_r.dk) = 'd') THEN _r.rupiah ELSE 0 END,
						TRUE);
					END IF;
					PERFORM saldo_perekananforwardupdate(_saldorekananid,IdProyek,_r.kdnasabah);
				END IF;
				/* akhir  */
				
				PERFORM trialbalanceforwardupdate(_trialbalid,IdProyek);

				UPDATE tbl_jurnal
				SET isposted=TRUE
				WHERE (id_jurnal=_r.id_jurnal);
			ELSE
				RETURN -1;
			END IF;
	END LOOP;
	RETURN 1;
END;
$_$;


ALTER FUNCTION public.trialbalancepostinto(integer, integer) OWNER TO postgres;

--
-- TOC entry 334 (class 1255 OID 1757206)
-- Name: updateretainedearnings(integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION updateretainedearnings(integer, integer) RETURNS integer
    LANGUAGE plpgsql
    AS $_$

DECLARE
  pYearPeriodid ALIAS FOR $1;
  IdProyek ALIAS FOR $2;
  _r RECORD;
  _n RECORD;
  _c RECORD;
  _beginningPeriodid INTEGER;
  _trialbalid INTEGER;
  _accntid INTEGER;
  _totalProfitLoss	NUMERIC;
  _periodid	INTEGER;
  _forwardupdate INTEGER;
BEGIN

--  First thing we need to do is to get the yearperiod
  SELECT * 
  INTO _r 
  FROM yearperiod 
  WHERE ((yearperiod_id = pYearPeriodid) AND (id_proyek=IdProyek));

  IF (NOT FOUND) THEN
    RETURN -6;
  END IF;

--  Now we need to find the next yearperiod
  SELECT * 
  INTO _n 
  FROM yearperiod 
  WHERE ((yearperiod_start = _r.yearperiod_end + interval '1 day')
  AND(id_proyek=IdProyek));

  IF (NOT FOUND) THEN
    RETURN -4;
  END IF;
  
  SELECT period_id 
  INTO _periodid 
  FROM period 
  WHERE ((period_start = _n.yearperiod_start) AND (id_proyek=IdProyek));

  IF (NOT FOUND) THEN
    RETURN -8;
  END IF;
  
  
  
  RETURN 0;

END;
$_$;


