--
-- TOC entry 335 (class 1255 OID 1757207)
-- Name: yearperiodclose(integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION yearperiodclose(integer, integer) RETURNS integer
    LANGUAGE plpgsql
    AS $_$

DECLARE
	pYearPeriodid ALIAS FOR $1;
	idproyek ALIAS FOR $2;
	_result INTEGER;
	_check RECORD;
BEGIN
--  cek data ada pa ga'
SELECT yearperiod_id, yearperiod_key, id_proyek, yearperiod_start, yearperiod_end, yearperiod_closed INTO _check
FROM yearperiod
WHERE (yearperiod_id = pYearPeriodid AND id_proyek = idproyek);

IF (NOT FOUND) THEN
	RETURN -3;
END IF;

-- periksa apakah yearperiod telah di tutup
  IF ( ( SELECT yearperiod_closed
           FROM yearperiod
          WHERE (yearperiod_id=pYearPeriodid AND id_proyek = idproyek ) ) ) THEN
    RETURN -1;
  END IF;

  IF ( ( SELECT (count(period_id) > 0)
           FROM period
          WHERE ((period_yearperiod_key= _check.yearperiod_key AND id_proyek = idproyek )
           AND (NOT period_closed)) ) ) THEN
    RETURN -10;
  END IF;

  IF ( ( SELECT (count(yearperiod_id) > 0)
           FROM yearperiod
          WHERE ((yearperiod_end< (
            SELECT yearperiod_end 
            FROM yearperiod 
            WHERE (yearperiod_id=pYearPeriodId AND id_proyek = idproyek ))
          )
           AND (NOT yearperiod_closed) AND id_proyek = idproyek ) ) ) THEN
    RETURN -11;
  END IF;

--  Should we check for a previous yearperiod existing already ?
--  If so then we should return -2 if one does not.

--  If we did the previous yearperiod we should check to make sure that
--  it is also closed. Returning -3 if it is not.

--  Make sure that the user is not trying to prematurely close the YearPeriod
  IF ( ( SELECT (yearperiod_end >= CURRENT_DATE)
           FROM yearperiod
          WHERE (yearperiod_id=pYearPeriodid AND id_proyek = idproyek ) ) ) THEN
    RETURN -5;
  END IF;

--  Update the year end Retained Earnings
  UPDATE yearperiod
    SET yearperiod_closed = TRUE
  WHERE yearperiod_id = pYearPeriodid AND id_proyek = idproyek ;

  RETURN 0;

END;
$_$;


