--
-- TOC entry 336 (class 1255 OID 1757208)
-- Name: yearperiodcreate(date, date, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION yearperiodcreate(date, date, integer) RETURNS integer
    LANGUAGE plpgsql
    AS $_$

DECLARE
	pStartDate ALIAS FOR $1;
	pEndDate ALIAS FOR $2;
	idproyek ALIAS FOR $3;
	_yearperiodid INTEGER;
	_seq_yearperiod INTEGER;
	_check INTEGER;
	_checkBool BOOLEAN;
	_r RECORD;
	_initial BOOLEAN;
BEGIN

--  Make that the passed start date doesn't fall into any existing yearperiod
SELECT yearperiod_id INTO _check
FROM yearperiod
WHERE ((pStartDate BETWEEN yearperiod_start AND yearperiod_end) AND id_proyek = idproyek);
IF (FOUND) THEN
	RETURN -1;
END IF;

--  Make that the passed end date doesn't fall into any existing yearperiod
SELECT yearperiod_id INTO _check
FROM yearperiod
WHERE ((pEndDate BETWEEN yearperiod_start AND yearperiod_end) AND id_proyek = idproyek);
IF (FOUND) THEN
	RETURN -2;
END IF;

--  Make that the passed start and end dates don't enclose an existing yearperiod
SELECT yearperiod_id INTO _check
FROM yearperiod
WHERE ( (yearperiod_start >= pStartDate)
AND (yearperiod_end <= pEndDate) AND id_proyek = idproyek );
IF (FOUND) THEN
	RETURN -3;
END IF;

--  Make sure that the passed start is prior to the end date
SELECT (pStartDate > pEndDate) INTO _checkBool;
IF (_checkBool) THEN
	RETURN -5;
END IF;

--  Determine if this is the initial accounting yearperiod
SELECT CASE WHEN(count(*) > 0) THEN FALSE ELSE TRUE END INTO _initial
FROM yearperiod;

--  Create the new accounting yearperiod
SELECT NEXTVAL('yearperiod_yearperiod_id_seq') INTO _yearperiodid;
SELECT seq_yearperiod_get(idproyek) INTO _seq_yearperiod;
VALUES ( _yearperiodid, _seq_yearperiod, pStartDate, pEndDate, FALSE , idproyek);

RETURN _yearperiodid;

END;
$_$;


