--
-- TOC entry 337 (class 1255 OID 1757209)
-- Name: yearperioddateschange(integer, integer, date, date); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION yearperioddateschange(integer, integer, date, date) RETURNS integer
    LANGUAGE plpgsql
    AS $_$

DECLARE
  pPeriodid ALIAS FOR $1;
  IdProyek ALIAS FOR $2;
  pStartDate ALIAS FOR $3;
  pEndDate ALIAS FOR $4;
  _check INTEGER;
  _checkBool BOOLEAN;
  _r RECORD;

BEGIN
--  cek data ada pa ga'
SELECT yearperiod_id, yearperiod_key, id_proyek, yearperiod_start, yearperiod_end, yearperiod_closed INTO _r
FROM yearperiod
WHERE ((yearperiod_id = pPeriodid) 
AND (id_proyek=IdProyek));

IF (NOT FOUND) THEN
	RETURN -6;
END IF;

--  Check to make sure that the passed yearperiod is not closed
  IF ( ( SELECT yearperiod_closed
         FROM yearperiod
         WHERE ((yearperiod_id=pPeriodid) AND (id_proyek=IdProyek)) ) ) THEN
    RETURN -1;
  END IF;

--  Check to make sure that the passed start date does not fall
--  into another yearperiod
  SELECT yearperiod_id INTO _check
  FROM yearperiod
  WHERE ( (pStartDate BETWEEN yearperiod_start AND yearperiod_end)
    AND (yearperiod_id <> pPeriodid) 
	AND (id_proyek=IdProyek))
  LIMIT 1;
  IF (FOUND) THEN
    RETURN -2;
  END IF;

--  Check to make sure that the passed end date does not fall
--  into another yearperiod
  SELECT yearperiod_id INTO _check
  FROM yearperiod
  WHERE ( (pEndDate BETWEEN yearperiod_start AND yearperiod_end)
    AND (yearperiod_id <> pPeriodid)
	AND (id_proyek=IdProyek))
  LIMIT 1;
  IF (FOUND) THEN
    RETURN -3;
  END IF;

--  Check to make sure that the passed yearperiod is not closed
  IF ( ( SELECT (count(period_id) > 0)
         FROM period
         WHERE ((period_yearperiod_key= _r.yearperiod_key)
          AND (period_start < pStartDate OR period_end > pEndDate)
		  AND (id_proyek=IdProyek)) ) ) THEN
    RETURN -4;
  END IF;

--  Make sure that the passed start is prior to the end date
  SELECT (pStartDate > pEndDate) INTO _checkBool;
  IF (_checkBool) THEN
    RETURN -5;
  END IF;


--  Alter the start and end dates of the pass period
  UPDATE yearperiod
  SET yearperiod_start=pStartDate, yearperiod_end=pEndDate
  WHERE ((yearperiod_id=pPeriodid) AND (id_proyek=IdProyek));

--  All done
  RETURN 1;

END;
$_$;


