    SELECT a.user_id, a.id_group, a.is_proyek, a.id_relasi, a.username, a.password, a.password_last_set, a.password_never_expired, a.remember_me, a.activation_code, a.active, a.forgot_code, a.forgot_generated, a.enabled, a.last_login, a.last_login_ip, a.created, b.userdata_id, b.fullname, b.email, c.nama_group, CASE WHEN (a.is_proyek = true) THEN 'Proyek'::character varying ELSE (SELECT aa.nama_unitkerja FROM tbl_unitkerja aa WHERE (aa.id_unitkerja = a.id_relasi)) END AS unit_kerja, gethakdata(a.is_proyek, a.id_relasi, a.user_id) AS hak_data, gethakakses(a.id_group) AS hak_akses FROM ((tbl_user a LEFT JOIN tbl_userdata b ON ((b.user_id = a.user_id))) LEFT JOIN tbl_groups c ON ((c.id_group = a.id_group)));


